["≈ªyzna 02", 52.230716, 20.779574, ["https://kmwawa.github.io/zapowiedzi-4/≈ªyzna.mp3", "https://kmwawa.github.io/zapowiedzi-3/PRZYSTANEK%20NA%20%C5%BB%C4%84DANIE.mp3"], "autobusowy"]



    ];

// Pe≈Çny skrypt z obs≈ÇugƒÖ zapowiedzi (jednej lub wielu), typem przystanku i kolorami znacznik√≥w

const selectedStops = [];
let currentIndex = 0;
let watchId = null;
let mapCentered = false;
let readyForNext = false;
const announcedNext = new Set();
const announcedArrival = new Set();
let previousStop = null;
let wakeLock = null;

const introAudioUrl = "https://kmwawa.github.io/zapowiedzi-2/NAST%C4%98PNY%20PRZYSTANEK.mp3";

const map = L.map('map').setView([52.2297, 21.0122], 13);
L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
  maxZoom: 18,
  attribution: '&copy; OpenStreetMap'
}).addTo(map);

const markers = [];

function getMarkerIcon(type) {
  const iconUrls = {
	grey: "https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-2x-grey.png",
    red: "https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-2x-red.png",
    orange: "https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-2x-orange.png",
    purple: "https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-2x-violet.png",
    blue: "https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-2x-blue.png",
	green: "https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-2x-green.png",
    shadow: "https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-shadow.png"
  };

  const typeToColor = {
    "sta≈Çy": "grey",
	"Zawieszony": "grey",
    "autobusowy": "purple",
    "tramwajowy": "red",
	"metro": "blue",
	"kolej": "green",
	"tramwajowo-autobusowy": "orange"
  };

  const color = typeToColor[type] || "blue";

  return new L.Icon({
    iconUrl: iconUrls[color],
    shadowUrl: iconUrls.shadow,
    iconSize: [25, 41],
    iconAnchor: [12, 41],
    popupAnchor: [1, -34],
    shadowSize: [41, 41]
  });
}

function parseStopData(stop) {
  const [name, lat, lon, audioField, maybeType] = stop;
  let audio = [];
  let type = "sta≈Çy";

  if (Array.isArray(audioField)) {
    audio = audioField;
    type = maybeType || "sta≈Çy";
  } else {
    audio = [audioField];
    type = maybeType || "sta≈Çy";
  }

  return { name, lat, lon, audio, type };
}

function getDistance(lat1, lon1, lat2, lon2) {
  const R = 6371000;
  const toRad = x => x * Math.PI / 180;
  const dLat = toRad(lat2 - lat1);
  const dLon = toRad(lon2 - lon1);
  const a = Math.sin(dLat / 2) ** 2 +
            Math.cos(toRad(lat1)) * Math.cos(toRad(lat2)) *
            Math.sin(dLon / 2) ** 2;
  const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
  return R * c;
}

function playMultiple(urls) {
  if (!urls.length) return;
  const [first, ...rest] = urls;
  const audio = new Audio(first);
  audio.play().then(() => {
    audio.onended = () => playMultiple(rest);
  }).catch(console.error);
}

function checkLocation(pos) {
  const { latitude: lat, longitude: lon } = pos.coords;
  let statusText = `üìç Pozycja: ${lat.toFixed(5)}, ${lon.toFixed(5)}`;

  if (currentIndex < selectedStops.length) {
    const { name: nextName, lat: stopLat, lon: stopLon } = parseStopData(selectedStops[currentIndex]);
    const distanceToNext = getDistance(lat, lon, stopLat, stopLon);
    statusText += ` | üöè Do przystanku ‚Äû${nextName}‚Äù: ${Math.round(distanceToNext)} m`;
  }

  document.getElementById('status').textContent = statusText;

  if (!mapCentered) {
    map.setView([lat, lon], 16);
    mapCentered = true;
  }

  renderMarkersInView();

  if (currentIndex >= selectedStops.length) return;

  const { name, lat: stopLat, lon: stopLon, audio: stopAudio } = parseStopData(selectedStops[currentIndex]);
  const distToNext = getDistance(lat, lon, stopLat, stopLon);
  const distFromPrevious = previousStop ? getDistance(lat, lon, previousStop[0], previousStop[1]) : Infinity;

  if (distToNext > 40 && distToNext < 50000 && distFromPrevious > 40 && !announcedNext.has(name)) {
    playMultiple([introAudioUrl, ...stopAudio]);
    announcedNext.add(name);
    readyForNext = true;
  }

  if (distToNext <= 70 && readyForNext && !announcedArrival.has(name)) {
    playMultiple(stopAudio);
    announcedArrival.add(name);
    previousStop = [stopLat, stopLon];
    currentIndex++;
    readyForNext = false;
  }
}

function handleError(err) {
  document.getElementById('status').textContent = "‚ùå B≈ÇƒÖd lokalizacji: " + err.message;
}

function addStopToList(name) {
  if (!name) return;
  const stop = stops.find(s => s[0] === name);
  if (!stop || selectedStops.find(s => s[0] === name)) return;
  selectedStops.push(stop);
  const li = document.createElement("li");
  li.textContent = name;
  document.getElementById('stop-list').appendChild(li);
}

function addManualStop() {
  const name = document.getElementById('stop-name').value.trim();
  addStopToList(name);
  document.getElementById('stop-name').value = "";
}

async function requestWakeLock() {
  try {
    if ('wakeLock' in navigator) {
      wakeLock = await navigator.wakeLock.request('screen');
      wakeLock.addEventListener('release', () => {
        console.log('üîì Wake Lock zwolniony');
      });
    }
  } catch (err) {
    console.error('B≈ÇƒÖd Wake Lock:', err);
  }
}

document.addEventListener('visibilitychange', () => {
  if (wakeLock !== null && document.visibilityState === 'visible') {
    requestWakeLock();
  }
});

function startAnnouncements() {
  if (watchId !== null) return;
  requestWakeLock();
  watchId = navigator.geolocation.watchPosition(checkLocation, handleError, {
    enableHighAccuracy: true,
    maximumAge: 0,
    timeout: 10000
  });
}

function clearStopList() {
  selectedStops.length = 0;
  currentIndex = 0;
  previousStop = null;
  readyForNext = false;
  announcedNext.clear();
  announcedArrival.clear();
  document.getElementById('stop-list').innerHTML = '';
}

function populateStopOptions() {
  const list = document.getElementById('stop-options');
  stops.forEach(([name]) => {
    const option = document.createElement("option");
    option.value = name;
    list.appendChild(option);
  });
}

function renderMarkersInView() {
  const bounds = map.getBounds();
  markers.forEach(m => map.removeLayer(m));
  markers.length = 0;

  stops.forEach(stop => {
    const { name, lat, lon, type } = parseStopData(stop);
    if (bounds.contains([lat, lon])) {
      const marker = L.marker([lat, lon], { icon: getMarkerIcon(type) }).addTo(map);
      marker.bindTooltip(name, { direction: 'top', offset: [0, -35] });
      marker.on("click", () => addStopToList(name));
      markers.push(marker);
    }
  });
}

map.on("moveend", renderMarkersInView);

navigator.geolocation.getCurrentPosition(
  pos => {
    map.setView([pos.coords.latitude, pos.coords.longitude], 16);
    mapCentered = true;
    renderMarkersInView();
  },
  handleError,
  { enableHighAccuracy: true }
);

populateStopOptions();

function skipCurrentStop() {
  if (currentIndex >= selectedStops.length) return;
  const { name, lat: stopLat, lon: stopLon, audio: stopAudio } = parseStopData(selectedStops[currentIndex]);
  announcedNext.add(name);
  announcedArrival.add(name);
  previousStop = [stopLat, stopLon];
  currentIndex++;
  readyForNext = false;

  if (currentIndex < selectedStops.length) {
    const { name: nextName, audio: nextAudio } = parseStopData(selectedStops[currentIndex]);
    playMultiple([introAudioUrl, ...nextAudio]);
    announcedNext.add(nextName);
    readyForNext = true;
  }
}

function announceSeveralStops(indices) {
  const audioUrls = [];
  for (const i of indices) {
    if (i >= 0 && i < selectedStops.length) {
      const { name, audio } = parseStopData(selectedStops[i]);
      audioUrls.push(introAudioUrl, ...audio);
      announcedNext.add(name);
      announcedArrival.add(name);
    }
  }
  playMultiple(audioUrls);
}

  
  </script>
